import React from 'react';
import { Nav, Navbar, Stack, Container, Button } from 'react-bootstrap';
import nuub_logo from '../assets/img/cropped-nuub_logo.png';

function Navigation(){
    return (
        <>
        <Navbar className="navigation" expand="lg">
                <Navbar.Brand href="#home" className="logo">
                    <img src={nuub_logo} width="246px" height="83px"/>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="navbar-nav" />
                <Navbar.Collapse id="navbar-nav">
                    <Stack direction="horizontal" gap={3} className="ms-auto">
                <Nav className="nav justify-content-end me-5">
                    <Nav.Link href="#services" className="me-3">Services</Nav.Link>
                    <Nav.Link href="#strategy" className="me-3">Strategy</Nav.Link>
                    <Nav.Link href="#cases&clients" className="me-3">Cases&Clients</Nav.Link>
                    <Nav.Link href="#about-us" className="me-3">About Us</Nav.Link>
                    <Nav.Link href="#contact-and-support" className="me-5">Contact and Support</Nav.Link>
                </Nav>
                </Stack>
                <Container className="language me-5">
                    <Button href="#english" className="me-3">EN</Button>{' '}
                    <Button href="#danish" className="ms-2">DA</Button>{' '}
                </Container>
                </Navbar.Collapse>
            
        </Navbar>

        </>
    );
}

export default Navigation
